import solution


def test() -> str:
    s = solution.Solution()

    input1 = ["abcd", "", "dba", "a", ""]
    input2 = ["abcde", "y", "dbac", "aa", ""]

    expectations = ["e", "y", "c", "a", "t"]

    if (len(input1) != len(input2)) or (len(input2) != len(expectations)) or (len(expectations) != len(input1)):
        return "test is invalid"

    for i in range(len(expectations)):
        assert (0 <= len(input1[i]) and len(input1[i]) <= 1000)
        assert (len(input2[i]) == len(input1[i]) + 1)

        assert (input1[i] == input1[i].lower())
        assert (input2[i] == input2[i].lower())

        result = s.findTheDifference(input1[i], input2[i])

        failMsg = (f"TEST #{i} FAILED: bad result for {input1[i]} and {input2[i]}: got {
                   result} expected {expectations[i]}")

        if result != expectations[i]:
            return failMsg

    return "PASS"


if __name__ == '__main__':
    print(test())
